import { Container, Row, Col } from "shards-react";
import BobaTracker from "./components/BobaTracker/BobaTracker.js";

import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import "shards-ui/dist/css/shards.min.css";

function App() {
  return (
    <Container>
      <Row>
        <Col>1 / 6</Col>
        <Col>2 / 6</Col>
        <Col>3 / 6</Col>
        <Col>4 / 6</Col>
        <Col>5 / 6</Col>
        <Col>6 / 6</Col>
      </Row>

      <Row>
        <Col>1 / 3</Col>
        <Col>2 / 3</Col>
        <Col>3 / 3</Col>
      </Row>

      <Row>
        <Col>1 / 2</Col>
        <Col>2 / 2</Col>
      </Row>

      <Row>
        <Col>1 / 1</Col>
      </Row>
    </Container>
  );
}

export default App;
